                let that = this;
                new QRCode(this.$refs.qrcode, {
                    width: 150,
                    height: 150, // 高度
                    text: that.url // 二维码内容
                })
            },
            clickGeneratePicture() {
                this.show=false;
                // html2canvas(this.$refs.imageDom).then(canvas => {
