                //    let img = document.createElement("img");
                //    img.src = this.imgUrl;

                    // let mod = document.getElementById('action-box');
                    // mod.appendChild(img);
                    // img.style.width="100%";
                     this.$toast.success("请下滑保存图片")
                    // console.log(this.imgUrl)
                // }).catch(error => {
                //     alert(error);
                // });
            },
            doCopy: function () {
                let that = this;
                this.$copyText(this.url).then(function () {
                    that.$toast('分享链接，复制成功')
                }, function () {
                    that.$toast('复制失败')
                })
            }
        }
    }
</script>

